export class Class {
    id: number = 0;
    student: string = "";
    tutor: string = "";
    subject: string = "";
    description: string = "";
    datetime: Date = new Date();
    doubletime: boolean = false;
    approved: boolean = false;
    explanation: string = "";
    review: number = 0;
    comment: string = "";
}
